  return (
    <div>
      <h1>Home</h1>
    </div>
  );
}


function Catagories() {
  return (
    <div>
      <h2>Catagories</h2>
    </div>
  );
}

function Sell() {
  return (
    <div>
    <Link to="/addItem">addItem</Link>
      <Switch>
        <Route path="/addItem">
          <AddItem />
        </Route>
        </Switch>
    </div>
  );
}
function AddItem() {
  return (
    <div>
      <h2>Adding ITem</h2>
    </div>
  );
}

export default App;
